Группа Компаний Альфа – это динамично развивающаяся проектно-строительная группа, успешно работающая по всей территории России и ближнего зарубежья с 2004 года.  В группу входят 6 компаний, которые объединяет отличительная черта нашей группы – это надежность и высокое качество поставляемых услуг.

Данный приоритет исключительной надежности и первоклассного качества прививается каждому сотруднику с первого дня его работы в любой из компаний нашей группы. Все звенья компаний, от монтажных бригад до руководителей, постоянно совершенствуют качество работ и никогда не останавливаются на достигнутом. Это основной принцип работы Группы Компаний Альфа. 

В настоящее время сфера деятельности нашей группы включает в себя:

- Комплексное строительство зданий и сооружений, включая генподрядные и общестроительные работы, установку инженерных и слаботочных сетей;
- Комплексное проектирование, включая генпроектирование, проектирование отдельных разделов и градостроительную документацию;
- Комплексная эксплуатация зданий, включая техническую эксплуатацию и управление недвижимостью;
- Инвестиционное консультирование, оценка и покупка-продажа бизнеса.
